webpackJsonp([0x786aded94520],{1118:function(A,e){A.exports={data:{markdownRemark:{html:'<p>Today’s interview is with James Finder, an ID I met on the instructional design subreddit. James is our first ID entrepreneur on the show. If you’re thinking about starting up a business and striking out on your own, James shares valuable insight for this path. James shares his instructional design journey, the interesting client industry he’s focusing on, and how he deals with the challenges of being a solo-preneur.</p>\n<iframe src="https://simplecast.com/e/38102?style=medium-light" width="100%" height="94px" frameborder="0" scrolling="no" seamless=""></iframe>\n<p>Remember: shownotes are on <a href="https://dearinstructionaldesigner.simplecast.fm/">Dear Instructional Designer show page</a>. Be sure to <a href="https://twitter.com/getplexdesign">hit James up on Twitter</a> and show him some love for sharing his experience. Also, <a href="https://itunes.apple.com/us/podcast/dear-instructional-designer/id1111995456?mt=2">leave a review on iTunes</a>. Let me know what you’re thinking about the podcast:</p>',frontmatter:{date:"June 23, 2016",path:"/blog/dear-instructional-designer-show-interview-with-james-finder",title:"Dear Instructional Designer Show!: Interview with James Finder",tags:["business","instructional design","solopreneur"],categories:["Dear ID Show"],featured:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:3,src:"/static/twitter-8f833ed6b7e5464c0e3be8d40e769b35-c6512.jpg",srcSet:"/static/twitter-8f833ed6b7e5464c0e3be8d40e769b35-c7d05.jpg 203w,\n/static/twitter-8f833ed6b7e5464c0e3be8d40e769b35-784f5.jpg 405w,\n/static/twitter-8f833ed6b7e5464c0e3be8d40e769b35-c6512.jpg 810w,\n/static/twitter-8f833ed6b7e5464c0e3be8d40e769b35-adada.jpg 1215w,\n/static/twitter-8f833ed6b7e5464c0e3be8d40e769b35-1c372.jpg 1500w",sizes:"(max-width: 810px) 100vw, 810px"}}}}}},pathContext:{}}}});
